let match;export const getParams=()=>match;export const Switch=o=>{for(const t in o){const n=(t.match(/:(\w+)/g)||[]).map(o=>o.slice(1)),c=new RegExp(t.replace(/:\w+/g,"(\\w+[\\w\\-\\.]*)")),e=window.location.hash.match(c);if(!e)continue;const[a,...h]=e;return match=n.reduce((o,t,n)=>({...o,[t]:h[n]}),{}),o[t](match)}};export const registerRouter=o=>{-1===window.location.href.indexOf("#/")&&(window.location.hash="#/"),window.onhashchange=o};export const push=o=>{window.location.hash=o};
